        adjust_hue: function(deg,save){
            if(save===undefined||save===true){
                return addSubColor
                        .call(
                            this,
                            function(){ return this.adjust_hue(deg, false); },
                            'adjust_hue('+deg+')'
                        );
            }
            var rgb,
                hsla = this.hsla().slice(0),
                diff = 360 - (hsla[0] + deg);

            hsla[0] = diff > 360 ? 360 - (diff % 360) : Math.abs(diff % 360);
            rgba = hslToRGB(hsla);

            return {rgb: rgba.slice(0, 3),
                    rgba: rgba,
                    hex: rgbToHEX(rgba),
                    hsl: hsla.slice(0, 3),
                    hsla: hsla};
        },
